// --- 3. VERİLERİ DÜZLEŞTİRME VE SQL SORGUSUNA HAZIRLAMA ---
const productsToInsert = [];

// Kategoriler içinde döngü kur (knives, gloves, pistols vs.)
for (const [category, items] of Object.entries(rawData)) {
    // Ürünler içinde döngü kur
    for (const item of items) {
        productsToInsert.push([
            item.name,
            item.price,
            item.img,
            category,     
            item.float,
            item.rarity,
            item.pattern
        ]);
    }
}

// --- 4. VERİTABANINA BASMA İŞLEMİ ---
const sql = "INSERT INTO products (name, price, img, category, float_val, rarity, pattern_val) VALUES ?";

console.log("---------------------------------------------------");
console.log("🧹  Eski veriler temizleniyor...");

db.query("TRUNCATE TABLE products", (err) => {
    if (err) {
        console.error("❌ HATA: Tablo temizlenemedi!", err);
        process.exit(1);
    } else {
        console.log("✅  Tablo tertemiz yapıldı.");
        console.log(`📦  Toplam ${productsToInsert.length} adet yeni ürün ekleniyor...`);

        db.query(sql, [productsToInsert], (err, result) => {
            if (err) {
                console.error("❌ HATA: Ürünler eklenirken sorun çıktı!", err);
            } else {
                console.log(`🎉  BAŞARILI! Toplam ${result.affectedRows} ürün veritabanına işlendi.`);
                console.log("🚀  Şimdi sunucuyu (server.js) yeniden başlatabilirsin!");
            }
            db.end();
            process.exit();
        });
    }
});
